import Axios from "axios";

const host = "http://127.0.0.1:4567"

const AxiosPost = async (link, data) => {
    let response;
    await Axios.post(`${host}${link}`, data).then((res) => {
        response = res;
    })
    return response;
}

export {AxiosPost};
